import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import AddTrip from './components/AddTrip';
import ViewTrips from './components/ViewTrips';
import EditTrip from './components/EditTrip';

const App = () => {
  return (
    <Router>
      <nav>
        <ul>
          <li><Link to="/">Inicio</Link></li>
          <li><Link to="/add-trip">Agregar Viaje</Link></li>
          <li><Link to="/view-trips">Consultar Viajes</Link></li>
        </ul>
      </nav>
      <Switch>
        <Route exact path="/" render={() => <h1>Bienvenido a la gesti√≥n de viajes</h1>} />
        <Route path="/add-trip" component={AddTrip} />
        <Route path="/view-trips" component={ViewTrips} />
        <Route path="/edit-trip/:id" component={EditTrip} />
      </Switch>
    </Router>
  );
};

export default App;
